### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Software Testing Basics**
- **Functional Requirements**: Specify the expected behaviors and relationships between inputs and outputs of a system.
- **Coupling Types**: Understanding different types of coupling between software modules (e.g., parameter coupling).

#### 2. **Partition Testing**
- **Base Choice Coverage Criteria (BCC)**: Understanding how to determine the number of additional tests required to satisfy BCC.
- **Equivalence Class Partitions**: Identifying equivalence class partitions based on input ranges.

#### 3. **Logical Expressions**
- **Conjunctive Normal Form (CNF) and Disjunctive Normal Form (DNF)**: Classifying logical expressions into CNF, DNF, or none.
- **Predicate Logic**: Understanding predicates and their satisfiability and tautology properties.

#### 4. **Control Flow Graph (CFG) and Path Testing**
- **All-defs Coverage**: Understanding path coverage criteria for variables.
- **Edge-Pair Coverage**: Identifying sets of test paths that provide edge-pair coverage.
- **Cyclomatic Complexity**: Calculating the cyclomatic complexity of a CFG.

#### 5. **Boundary Value Analysis (BVA)**
- **Boundary Values**: Identifying correct sets of test cases for BVA.

#### 6. **Symbolic Execution**
- **Path Constraints**: Identifying path constraints for symbolic execution.
- **Symbolic State**: Understanding the symbolic state of variables at the end of symbolic execution.

#### 7. **Truth Tables and RACC/RICC Pairs**
- **RACC (Robust Active Clause Coverage) and RICC (Robust Inactive Clause Coverage) Pairs**: Identifying pairs from truth tables.

### Equations and Key Concepts

#### Logical Expressions
1. **CNF and DNF**:
   - CNF: \( (a_1 \lor a_2) \land (b_1 \lor b_2 \lor b_3) \)
   - DNF: \( (a_1 \land a_2) \lor (b_1 \land b_2 \land b_3) \)

2. **Predicate Logic**:
   - \( p = c \lor (a \land \neg b) \)
   - \( p = a \land (b \lor c) \)

#### Boundary Value Analysis
- For a partition \( 45 \leq score \leq 100 \), the boundary values are: {44, 45, 46, 50, 99, 100, 101}

#### Cyclomatic Complexity
- **Formula**: \( V(G) = E - N + 2 \)
  - \( E \) = number of edges
  - \( N \) = number of nodes

